import React, { useState, useEffect } from 'react';
import { Link } from 'react-router-dom';
import '../App.css';

import { useSelector, useDispatch } from 'react-redux';
import { listPuppies } from '../actions/puppyActions';
import { Jumbotron, Card,  Container, CardDeck, CardGroup,Nav, Col, Row, Tab } from 'react-bootstrap';

const PuppiesPage = (props) => {
    const puppyList = useSelector(state => state.puppyList);
    const { puppies, loading, error } = puppyList;
    const dispatch = useDispatch();
    useEffect(() => {
        dispatch(listPuppies());
        return () => {
        };
    }, [])
    return loading? <div>loading...</div>:
    error? <div>{error}</div>:
    <div className="HomeContainer">

<div className="">
<h1>Puppies</h1>



    <div className="">
        <p id="subTitle">  </p>
    <div className=""> 

{ puppies.filter(puppies => puppies.status === 'Available').map(puppy =>  
            <Link to={'/puppy/' + puppy._id}>
      <div id="PuppyHomeCard"> 

              <Row>
                  <Col>
            <img src={puppy.image} />
                  </Col>
                  <Col>
               <div id="">
                   Name: {puppy.name}
               </div>
                <div className="puppy-gender">{puppy.gender}</div>
                <div className="puppy-price"> ${puppy.price}</div>
                </Col>
                </Row>

        </div>
        </Link>)

}

    </div>
    </div>


    </div>
    </div>
}
export default PuppiesPage;
